import React from 'react'
import ItemCard from './ItemCard'

const Items = () => {
    const dummyItem = {
        picLocaton:'./assets/dummy.jpeg',
        name: 'Dummy Item',
        description: 'This is a dummy item because it is a dummy',
    }

  return (
    <>
        <ItemCard cl {...dummyItem}/>
        <ItemCard {...dummyItem}/>
    </>
  )
}

export default Items
